import React from "react";
function ExpenseItem() {
  return (
    <div>
      <div>March 28th 2021</div>
      <div>
        <div>Car Insurance</div>
        <div>4000Rs</div>
      </div>
    </div>
  );
}
export default ExpenseItem;
